import React, {useState, useEffect} from 'react'

import UserService from '../Services/UserService'
import FetchClient from '../ServiceClients/FetchClient'

const UserProfile = () => {
    const [user, setUser] = useState([])

    useEffect(() => {
        const userService = new UserService(FetchClient)
        const fetchUser = async ()=>{
            try {
                const user = await userService.getUsers(1);
                setUser(user);
                console.log(user);
            } catch (error) {
                console.error(error)
            }
        }

        fetchUser()
    },[])

    const handleCreateUser = async (user) => {
        try {
            const createUser = await userService.createUser(user);
            setUser([...user, createUser]);
        } catch (error) {
            console.error(error);
        }
    };
  return (
    <div>
      <button onClick={() => handleCreateUser({
                first_name: 'FEFirstname',
                last_name: 'FELastname',
                email: 'FELast@email.com',
                pass_word: '12345'
            })}>
        Create User
        </button>
        <ul>
            <li key={user.user_id}>{user.first_name} {user.last_name}</li>
        </ul>
    </div>
  )
}

export default UserProfile;
